import styled from "styled-components";

export const SectionMovieStyle = styled.section`
  width: 1003px;
  overflow: hidden;
  background-color: #fff;
  border-radius: 15px;
  padding: 26px 27px 30px;
  margin-top: 23px;
`;

export const UlStyle = styled.ul`
  display: grid;
  grid-template-columns: 1fr 1fr 1fr 1fr;
  gap: 24px;
`;
